function getSelect(layer, id){
    helperText = '<p class="large">2. Select a district on map or by name';
    nameSelect = '<select class="form-control" onChange="showFeature(this)" class="name" id="'+layer+'-name-select"><option>[Representative Name]</option>';
    geogSelect = '<select class="form-control" onChange="showFeature(this)" class="geog" id="'+layer+'-select"><option>[' + geoLayers[layer].name_sing + ']</option>';
    
    // Tells us whether layer has representative (e.g., senate, house, congress)
    var nameBool = true;
    if (layer === "rc" || layer === "county") {
        nameBool = false;
    }
    // Sort select arrays for display
    // console.log("entity = " + params[1]);
    geoLayers[layer].select.geog.sort();
    geoLayers[layer].select.name.sort(sortFunction);

    $.each(geoLayers[layer].select.geog, function(i, val){

        var selectedGeog = '';
        var selectedName = '';

        if (load && typeof id !== "undefined" && id == val[1]) {
         // console.log(val[1]);
            selectedGeog = "selected";
            // load = false;
        }
        if (load && typeof id !== "undefined" && nameBool && id == geoLayers[layer].select.name[i][1]){
            selectedName = "selected";
            // load = false;
        }
        geogSelect += '<option value="' + val[1] + '" ' + selectedGeog + '>' + val[0] + '</option>';
        // geogSelect += '<option>' + val + '</option>';
        if (nameBool && geoLayers[layer].select.name[i] ){
            nameSelect += '<option value="'+geoLayers[layer].select.name[i][1]+'" '+selectedName+'>' + geoLayers[layer].select.name[i][0] + '</option>';
            // nameSelect += '<option value="'+nameArray[i][1]+'">' + nameArray[i][0] + '</option>';
        }
    });
    if (!nameBool){
        nameSelect = '';
        helperText += '.</p>';
    }
    else{
        nameSelect += '</select><br />';
        helperText += ' / representative.</p>';
    }
    geogSelect += '</select><br />';

    $('#district-selects').html(helperText + 
                                geogSelect + 
                                nameSelect);    
}
function sortFunction(a, b) {
    if (a[0] === b[0]) {
        return 0;
    }
    else {
        return (a[0] < b[0]) ? -1 : 1;
    }
}
function getName(props){
    if (typeof props !== "undefined" && props.DISTRICT){
        return props.DISTRICT;
    }
    else if (typeof props !== "undefined" && props.name != 'null'){
        return props.name;
    }
    else {
    	return "Georgia";
    }
}
function numberWithCommas(x) {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}
function getCounties(geoIds){
	var names = [];
	var counties = geoLayers.county.data.toGeoJSON().features;
	for (var i = geoIds.length - 1; i >= 0; i--) {
		for (var j = counties.length - 1; j >= 0; j--) {
			if (geoIds[i] === counties[j].properties.GEOID10){
				names.push(counties[j].properties.name);
			}
		}
	}
	return names;
	
}

function getId(props){
    if (typeof props !== "undefined" && props.DISTRICT){
        return props.DISTRICT;
    }
    else if (typeof props !== "undefined" && props.acronym){
        return props.acronym;
    }
    else if (typeof props !== "undefined" && props.GEOID10){
        return props.GEOID10;
    }
    else if (typeof props !== "undefined" && props.acronym){
        return props.acronym;
    }
}

