function toPhone(text){
    text = text.replace(/(\d{3})(\d{3})(\d{4})/, "$1-$2-$3");
    return text;
}

function getOrdinal(n) {
   var s=["th","st","nd","rd"],
       v=n%100;
   return n+(s[(v-20)%10]||s[v]||s[0]);
}

function getLongName(name){
    if (isDistrict(currentLayer)){
        name = 'the ' + getOrdinal(+name) + ' ' + geoLayers[currentLayer].name_sing;
    }
    else if (currentLayer === 'rc'){
        name = 'the ' + name;
    }
    else {
        name = name + ' County';
    }
    if (name === 'Georgia County'){
        name = 'Georgia';
    }
    return name;
}
function getLongNameTitle(name){
    if (isDistrict(currentLayer)){
        name = 'The ' + getOrdinal(+name) + ' ' + geoLayers[currentLayer].name_sing;
    }
    else if (currentLayer === 'rc'){
        name = 'The ' + name;
    }
    else {
        name = name + ' County';
    }
    if (name === 'Georgia County'){
        name = 'The State of Georgia';
    }
    return name;
}

function toSentence(arr){
  var s;
  if (arr.length === 1){
    s = arr.join();
  }
  else if (arr.length === 2){
    s = arr.join(' and ')
  }
  else{
    s = arr.slice(0, arr.length - 1).join(', ') + ", and " + arr.slice(-1);
  }
  return s;
}

function makeUL(array, array2) {
    // Create the list element:
    var list = document.createElement('ul');

    for(var i = 0; i < array.length; i++) {
        // Create the list item:
        var item = document.createElement('li');

        // Set its contents:
        var text;
        if (array[i] !== array2[i]){
            text = array[i] + ' (' + array2[i] + ')';
        }
        else{
            text = array[i];
        }
        item.appendChild(document.createTextNode(text));

        // Add it to the list:
        list.appendChild(item);
    }

    // Finally, return the constructed list:
    return list;
}
function populateTable(array, array2) {
  // Create the tbody element:
  var tbody = document.createElement('tbody');
    for(var i = 0; i < array.length; i++) {
      // Create the row element:
      var row = document.createElement('tr');
        // Create the row item:
        if (i % 2 === 0){
          var item = document.createElement('td');
          var item2 = document.createElement('td');
          // Set its contents:
          var text;
          if (array[i] !== array2[i]){
              text = array[i] + ' (' + array2[i] + ')';
          }
          else{
              text = array[i];
          }
          var odd = array[i + 1];
          var oddAbbr = array2[i + 1];
          item.appendChild(document.createTextNode(text));
          if(typeof odd !== 'undefined'){
            var text;
            if (odd !== oddAbbr){
                text = odd + ' (' + oddAbbr + ')';
            }
            else{
                text = odd;
            }
            item2.appendChild(document.createTextNode(text));
          }
          // Add it to the row:
          row.appendChild(item);
          row.appendChild(item2);
          tbody.appendChild(row);
        }
        
    }

    // Finally, return the constructed list:
    return tbody;
}

